paths:
  tmp0:
    post:
      description: Search for Actor Report IDs based on keyword query string
      parameters:
      - description: General term to search for
        example: ''
        in: query
        name: Query
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: CrowdStrike Query Actor Reports
  tmp1:
    post:
      description: Search for actor reports given an ID
      parameters:
      - description: CSV list of actor report IDs to get info about
        example: ''
        in: query
        name: Actor Report IDs
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: CrowdStrike Search Actor Reports By ID
  tmp10:
    post:
      description: Query for indicator IDs using a keyword query string
      parameters:
      - description: Indicator Value to Search For
        example: www.we11point.com
        in: query
        name: Indicator
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: CrowdStrike Query Indicator
  tmp11:
    post:
      description: Update information about a CrowdStrike indicator
      parameters:
      - description: Indicator to get info on
        example: domain:google.com
        in: query
        name: Indicator
        required: true
        schema: {type: string}
      - description: Description of the indicator, 200 chars max
        example: ''
        in: query
        name: Description
        required: false
        schema: {type: string}
      - description: Source of this indicator, 200 chars max
        example: ''
        in: query
        name: Source
        required: false
        schema: {type: string}
      - description: CrowdStrike policy for this indicator
        example: ''
        in: query
        name: Policy
        required: false
        schema: {type: string}
      - description: How long until this indicator expires
        example: ''
        in: query
        name: Expiration Days
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp11'}
          description: Successful request
      summary: CrowdStrike Update Indicator
  tmp12:
    post:
      description: Get Report from ReportAPI
      parameters:
      - description: Report IDS comma separated
        example: 2234,1123,6665
        in: query
        name: Report IDs
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp12'}
          description: Successful request
      summary: CrowdStrike Get Report
  tmp13:
    post:
      description: Search Reports in ReportAPI
      parameters:
      - description: Query for searching Report API
        example: ''
        in: query
        name: Query
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp13'}
          description: Successful request
      summary: CrowdStrike Search Reports
  tmp14:
    post:
      description: CrowdStrike Real Time Response Admin Command Result
      parameters:
      - description: Cloud Request ID from Command Run
        example: ''
        in: query
        name: Cloud Request ID
        required: true
        schema: {type: string}
      - description: Sequence ID
        example: ''
        in: query
        name: Sequence ID
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp14'}
          description: Successful request
      summary: CrowdStrike RTR CMD Result
  tmp15:
    post:
      description: CrowdStrike Real Time Response Admin Command Run
      parameters:
      - description: Device ID
        example: ''
        in: query
        name: Device ID
        required: true
        schema: {type: string}
      - description: Any Real Time Response command to run (ls, cat, env, encrypt,
          kill, rm, zip, unmap, ...)
        example: ls
        in: query
        name: command
        required: true
        schema: {type: string}
      - description: Any args required for command. If command is `cat`, arg should
          be `path/to/file`
        example: ''
        in: query
        name: Arguments
        required: false
        schema: {type: string}
      - description: Optional Session ID. If not provided one will be created.
        example: ''
        in: query
        name: Optional Session ID
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp15'}
          description: Successful request
      summary: CrowdStrike RTR Admin CMD Run
  tmp16:
